import React from "react";

const AboutMe = () =>{
  return(
    <div>Hi, I am Colin Maguire, a programmer, specialising in Game Development, from London, Ontario, who loves to code.

    <p>I recently graduated from Fanshawe College in 2020, where I obtained a graduate certificate for Software and Information Systems Testing. Before that,
    I graduated from Niagara College in 2017, where I obtained an advanced diploma in Game Development. Learning everything about game development from the 3D modelling to game docuements.
    But mostly focused on the programming side of things, where I learned how to do AI, networking and game mechanics, just to name a few of the topsic that were taught.</p>

    <p>If you would like a copy of my resume, please feel free to email me using the link in the header, thanks.</p></div>
  );
}

export default AboutMe;
